import React from 'react';
import logo from '../images/1920px-Netflix_2015_logo.svg.png';
import './LogInScreen.css';
const LogInScreen = () => {
    return(
        <div className='logInScreen'>
            <div className='loginScreen__coloring'>
                <div className='logInScreen__nav '>
                    <img className='nav__logo' src={logo} alt='Netflix-Logo'/>
                    <button className='logInScreen__signIn'>Sign In</button>
                </div>

                <div className='logIn__content'>
                    <h1>Unlimited movies, TV shows, and more.</h1>
                    <h2>Watch anywhere. Cancel anytime.</h2>
                    <h3>Ready to watch? Enter your email to create or restart your membership.</h3>
                    <form>
                        <input type='email' placeholder='Email Address' />
                        <button>GettingStarted</button>
                    </form>
                </div>
            </div>
  
        </div>
    )
}

export default LogInScreen;
